import { del } from "../../../api/monitor/online";
import CRUD, { presenter, header, crud } from "../../../components/Crud/crud";
import rrOperation from "../../../components/Crud/RR.operation";
import crudOperation from "../../../components/Crud/CRUD.operation";
import pagination from "../../../components/Crud/Pagination"; // crud交由presenter持有

var defaultCrud = CRUD({
  url: 'auth/online',
  title: '在线用户'
});
export default {
  name: 'OnlineUser',
  components: {
    pagination: pagination,
    crudOperation: crudOperation,
    rrOperation: rrOperation
  },
  mixins: [presenter(defaultCrud), header(), crud()],
  data: function data() {
    return {
      delLoading: false,
      permission: {}
    };
  },
  created: function created() {
    this.crud.msg.del = '强退成功！';
    this.crud.optShow = {
      add: false,
      edit: false,
      del: false,
      download: true
    };
    this.resetQuery();
  },
  methods: {
    resetQuery: function resetQuery() {
      this.crud.resetQuery(false);
      this.crud.refresh();
    },
    doDelete: function doDelete(datas) {
      var _this = this;

      this.$confirm("\u786E\u8BA4\u5F3A\u9000\u9009\u4E2D\u7684".concat(datas.length, "\u4E2A\u7528\u6237?"), '提示', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(function () {
        _this.delMethod(datas);
      }).catch(function () {});
    },
    // 踢出用户
    delMethod: function delMethod(key, index) {
      var _this2 = this;

      var ids = [];

      if (key instanceof Array) {
        key.forEach(function (val) {
          ids.push(val.key);
        });
      } else ids.push(key);

      this.delLoading = true;
      del(ids).then(function () {
        _this2.delLoading = false;

        if (_this2.$refs[index]) {
          _this2.$refs[index].doClose();
        }

        _this2.crud.dleChangePage(1);

        _this2.crud.delSuccessNotify();

        _this2.crud.toQuery();
      }).catch(function () {
        _this2.delLoading = false;

        if (_this2.$refs[index]) {
          _this2.$refs[index].doClose();
        }
      });
    }
  }
};
